('2412','18','7922','Villa Ewing',Null,'Einzigartige Villa in erster Meereslinie mit fantastischem Meerblick','33883','Nur 5 Autominuten von Palma de Mallorca entfernt befindet sich dieses Luxus-Villa in 1. Meereslinie auf einem 2.000m² großen Grundstück. Die Villa wurde umfassend renoviert im Jahre 2008. Das ca. 1.000m² Wohnfläche verteilt sich auf 2 Wohn Etagen verteilt und bietet auf der oberen Etage 6 Schlafzimmer mit Bädern en suite. Im Erdgeschoss Wohn-Esszimmer, Küche und Zugang zum mediterranen Garten mit Terrassen und Salzwasser-Pool aswell Jacuzzi. Darüber hinaus bietet diese außergewöhnliche Vila sogar einen Studienraum mit Sitzecke, 2 Gäste-Apartments mit September Zugang in den Keller, 2 Mitarbeiter Schlafzimmer, ein Hallenbad mit Wellnessbereich und einen Fitnessraum und ein Heimkino. Alle Etagen sind mit einem Aufzug verbunden sind. 5 Autos passt in der Garage neben es hat immer noch außerhalb Parkplätze für 4 Autos mehr. Zur Ausstattung gehören eine Zentralheizung (Gas, Wärmepumpe), Klimaanlage w / k, Parkettböden, einen Kamin und eine Alarmanlage.','33884','14700000','106','2015-12-09 13:56:07','106','2015-12-09 13:56:52',Null,'2540','105','1193',1,'1','0',Null,Null,Null,'33885',Null,'0','0','0',Null,'2015-12-09 14:48:11',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33886',Null,'33887',Null,'33888',Null,'33889','00971 507 062 087 ','33890','0',0,'0');
